import React from 'react'

export default function Task(props) {
    const task = props.task
    return (
        <div className="task-block">
            <h1 className="title">{task.title}</h1>
            <div className="description">{task.desc}</div>
            <input type="checkbox"/>
            <data></data> {task.dueDate}
        </div>
    )
}
